import { library } from "@fortawesome/fontawesome-svg-core";

import {
  faCode,
  faHighlighter,
  faAtom,
  faGraduationCap,
  faGlobeAmericas,
  faEnvelope
} from "@fortawesome/free-solid-svg-icons";

library.add(
  faCode,
  faHighlighter,
  faAtom,
  faGraduationCap,
  faGlobeAmericas,
  faEnvelope
);
